import React from 'react';
import styles from './MainItem.module.css';

const MainItem = (props) => (
  <div className={styles.MainItem}>
    <ul>
      <li>
        <h2>{props.title}</h2>
        <p>Short description</p>
        <p>Tech Stack</p>
      </li>
      <li>
        <button>Plus sign</button>
      </li>
    </ul>
  </div>
);

export default MainItem;
